NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6B9C46D54CEC3D81CE7008A95C9F8CF5", "Не забывайте о состоянии ваших войск! Мораль и численность отряда очень важны при затяжных сражениях."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "96036A544523A37A650FFDB0DCF09450", "Если разведчик долго не возвращается возможно его заметили."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "BF1632EA4315BCE32C31FDBD006100C6", "Наши разведчики могут найти выход из самых сложных ситуаций, но даже им не под силу пережить задачу по проникновению в центр армии противника."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "C9C714C747665FDC21B05A9B076D7A56", "В опасных ситуациях иногда лучше отступить и перегруппироваться, чтобы потом нанести решающий удар."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6225C8964A1FD4A030123BB8B908FABE", "Обращайте внимание на местность и рельеф, на которых собираетесь вести бой."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "7403B0B8485795FD13C12B9B92B8279B", "Занять тактически выгодную позицию — это уже половина победы."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6D02A4F3490D7FFAB9B36BBCCE80F816", "Будьте внимательны при преследовании отступающего противника — можно угодить в засаду или же ваша армия оторвется от подкреплений."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "1A88F93845D6B6CEFF6FC79B9C339894", "В начале следует определиться с приоритетами. Распространенная ошибка — ставить перед собой слишком много целей. Растягивание войск во все стороны неизбежно приводит к катастрофе."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "D80BAED3456B4C8D966EE29BE567BE32", "Используйте маневры на широком фронте: разделите свои силы на отдельные колонны для эффективных атак на фланги и в тылы противника. Такова основная тактика казачьи конницы начала XIX века"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "AE2D99CD4249A5CA0287869831F11F86", "При атаке используйте свои силы так, чтобы угрожать противнику с разных направлений."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6FAF04D843A7ACBBD6F267A3377F3080", "Не забывайте об обеспечении: поддерживайте свои войска необходимыми ресурсами и оборудованием, чтобы они могли эффективно выполнять свои задачи на поле боя."),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "D2A1627449BAA651CEA7418BDE342921", "Одна минута решает исход баталии; один час — успех кампании; один день — судьбу империи. (А.В.Суворов)"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "6879D2034FAA8094ED588D8ACF2818DF", "Теория без практики мертва, практика без теории слепа. (А.В.Суворов)"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "0E3632F94643E88432EA89BFF089C72D", "Нет выше чести, чем носить русский мундир. (М.И.Кутузов)"),NSLOCTEXT("[/Script/AsyncLoadingScreen]", "DADC89BA4BA31F4CBA238AB46D829997", "Победа требует времени, терпения и рассудительной медлительности. (М.И.Кутузов)")),Appearance=(ColorAndOpacity=(SpecifiedColor=(R=1.000000,G=1.000000,B=1.000000,A=1.000000),ColorUseRule=UseColor_Specified),Font=(FontObject="/Script/Engine.Font'/Game/UI/Alice-Regular_Font.Alice-Regular_Font'",FontMaterial=None,OutlineSettings=(OutlineSize=0,bSeparateFillAlpha=False,bApplyOutlineToDropShadows=False,OutlineMaterial=None,OutlineColor=(R=0.000000,G=0.000000,B=0.000000,A=1.000000)),TypefaceFontName="Default",Size=26.000000,LetterSpacing=0,SkewAmount=0.000000),ShadowOffset=(X=0.000000,Y=0.000000),ShadowColorAndOpacity=(R=0.000000,G=0.000000,B=0.000000,A=0.518000),Justification=Center),TipWrapAt=1000.000000,bSetDisplayTipTextManually=False),LoadingWidget=(LoadingIconType=LIT_Throbber,LoadingWidgetType=LWT_Horizontal,TransformTranslation=(X=0.000000,Y=0.000000),TransformScale=(X=1.000000,Y=1.000000),TransformPivot=(X=0.500000,Y=0.500000),LoadingText=NSLOCTEXT("[/Script/AsyncLoadingScreen]", "AE1F9FD74FE50F5DA9ED61832580E745", "Загрузка"),bLoadingTextRightPosition=True,bLoadingTextTopPosition=True,Appearance=(ColorAndOpacity=(SpecifiedColor=(R=1.000000,G=1.000000,B=1.000000,A=1.000000),ColorUseRule=UseColor_Specified),Font=(FontObject="/Script/Engine.Font'/Game/Fo